import React from 'react';
import {Axios as axios} from "axios";

const TextKeybComponent = () => {
    async function fetchTexts() {
        const response=await axios.get('https://baconipsum.com/api/?type=all-meat&sentences=6&start-with-lorem=10');
        console.log(response.data)
    }
    return (
        <div>
            <button onClick={fetchTexts}>GET TEXT</button>
        </div>
    );
};

export default TextKeybComponent;
